クリーンディーゼルエンジンから高性能自然吸気エンジンまで、あらゆるタイプのエンジンのポテンシャルを引き出します。<BR><BR>強力な油膜によりスポーツ走行から市街地走行まで、エンジンにとって過酷な状況下でもスムーズな加速を実現しました。<BR><BR>POLOオイルはアメリカ産高級ベースオイルを使用。ロスアンゼルス郊外のISO認証自社工場で一貫して生産をしています。POLOオイルの製造会社であるアメリカLSC社は世界的に有名な数々のオイルブランドのOEM生産を始め、NASAで使用される潤滑製品の製造も手掛けています。<BR><BR>特長：・最新鋭のクリーンディーゼルや高性能ガソリンエンジン、特に高回転型ガソリンエンジンに最適です。<BR><BR>・粘度を低く抑えることで、ピストンやエンジン各部にかかる粘性抵抗を軽減。エンジン各部が滑らかに動き、他に比を見ない高回転域まで伸びのある加速を実現します。<BR><BR>・ガソリンエンジン、ディーゼルエンジンどちらでも使用可能。<BR><BR>SAE：5W-30<BR><BR>API規格：SM/CF<BR><BR>第三石油類：1890<BR><BR>タイプ：100% 化学合成油<BR><BR>容量：18.9L（5ガロン）<BR><BR><style type="text/css">
