●電源が要らないのでどこでも作業簡単！<br><br>●自動車、トラクター・耕運機等の農耕機のエンジンオイル抜き取りに最適！<br><br>●公道を走れない車両などガレージ内で交換できる。<br><br>●オイルレベルゲージ穴を利用して、エンジンオイルを抜き取ります。<br><br>●リフトアップが不要なので作業も簡単！<br><br>●オイルパンにたまったスラッジもスッキリ抜き取れます。<br><br>●自分でできるので時間と費用が節約できます。<br><br>【仕様】<br><br>■材質<br>タンク：HDPE<br>台座/取っ手/排出ノズル/キャップ/吸引ホースアタッチメント：PE<br>ポンプ本体一部/ポンプ取付口一部：PVC<br><br>■タンク容量：6L<br>■サイズ/重量：約 W234×H540×D234mm/約 1.3kg<br>■吸引ホース先端外径：約 5.7mm<br>■吸引ホース全長：約 2.1m<br><br>メーカー：大自工業/Meltec<br>品番：OC-060<style type="text/css">
