ラスペネ ミニは、ラスペネの性能はそのままに「作業性」と「携帯性」を重視したコンパクトサイズの浸透防錆潤滑剤。
<br><br>
■ 浸透力と防錆性を有するフッ素樹脂配合の多目的浸透防錆潤滑剤。 <br>
■ ネジのゆるめと防錆、自動車など機械類の金属部分の潤滑と防錆に効果的です。<br> 
■ 水置換性を有し金属表面に付着している湿気を追い出し防錆被膜を作ります。 <br>
■ 狭い箇所でも使い易く、缶上部にくびれを設けた独自の缶形状と新設計したスプレーキャップを採用することにより手に心地良くフィットし、使用時に缶の滑り落ちを防止。<br> 
■ 噴射剤にジメチルエーテル（DME）を採用することで、霧状で少量噴射し易く、噴射後の後ダレを抑制。 <br>
■ ノズルは折りたたみ時には広く、ニードルノズルでは細く噴射する2WAYタイプ。 <br>
■ オリジナル特殊バルブを採用し、逆さまでの使用だけでなく360度どのような角度でも噴射可能。<br> 
■ 容量：180ml（NET） <br>
■ サイズ：高さ約145mm<style type="text/css">
